import React, { Component } from 'react'

class Photo extends Component {
    render(){
        const post = this.props.post;
        return <figure className="figure">
            <img className="Photo" src={post.imageLink} alt={post.description}>
            </img>
            <figcaption>
                <p>
                    post.description
                </p>
            </figcaption>
        </figure>
    }
}

export default Photo;
